import React from 'react';

/**
 * A component that renders a decorative, animated background with floating circles.
 * It should be placed in a container with position: relative.
 */
const AnimatedBackground = () => {
  return (
    <div className="animated-background">
      <ul className="circles">
        {[...Array(10)].map((_, i) => (
          <li key={i}></li>
        ))}
      </ul>
    </div>
  );
};

export default AnimatedBackground;
